import axios from 'axios';
import React, { Component } from 'react'

export default class contenido_selects extends Component {

    state = {
        documento: [],
        documentoTipo: ''
    }
    componentDidMount() {
        this.getdocumento();
    }
    getdocumento = () => {
        axios.get('http://localhost:8080/api/tipoDocumento')
            .then(res => {
                this.setState({
                    documento: res.data,
                });
                console.log(this.state);
            });
    }
    handleChange = (e) => {
        this.setState({
            documentoTipo: e.target.value
        })
    }
  render() {
    return (
      <div>contenido_selects</div>
    )
  }
}
